import React from 'react'
import { useState } from 'react'
import { Link } from 'react-router-dom'
import './Navigation.css'

const Navigation = () => {

  const poster_url = "https://image.tmdb.org/t/p/w500";

  const [query,setQuery] = useState('')
  const [movie,setMovie] = useState()

  const [isOpen,setOpen] = useState(false)

  const toggleNav = ()=>{
  setOpen(!isOpen)
  }


const searchMovies = async (e) =>{
  e.preventDefault()

  const searchUrl = `https://api.themoviedb.org/3/search/movie?api_key=27715af1593b0426691060d9f7ad58ee&en-US&query=${query}`

try{
  const response = await fetch(searchUrl)
  const responseJson = await response.json()
  setMovie(responseJson.results)
}catch(err){
 alert("No Find Your Search")
}

}


const inputChange = (e)=>{
  setMovie('')
  setQuery(e.target.value)

}


  return (
<header class="border-b border-gray-100">

<div class="mx-auto flex   items-center justify-between sm:px-6 lg:px-8">
<div class="flex items-center gap-4">

